‏ "#‌‎‌‏‌‎صلوا على الحبيب ♥️

‎#🎙القارئ اسلام صبحى
📖سورة الــــــــــــــزمر
📚ب ته فسيرا ساناهى 

﴿قُل يا عِبادِيَ الَّذينَ أَسرَفوا عَلى أَنفُسِهِم لا تَقنَطوا مِن رَحمَةِ اللَّهِ إِنَّ اللَّهَ يَغفِرُ الذُّنوبَ جَميعًا إِنَّهُ هُوَ الغَفورُ الرَّحيمُ﴾ [الزمر: ٥٣]

تو بێژه‌ وان به‌نییێن من يێن گه‌له‌ك ب ناڤ گونه‌هێ ڤه‌ چووين، و ب كرنا خرابییان ته‌عدايى ل خۆ كرى: ژ به‌ر گونه‌هێن خۆ يێن مشه‌ هوين ژ دلۆڤانییا خودێ بێ هيڤى نه‌بن، هندى خودێ‌یه‌ گونه‌هان هه‌مییان ژێ دبه‌ت بۆ وى يێ ژێ تۆبه‌ بكه‌ت و ل خۆ بزڤڕت، هندى ئه‌وه‌ ئه‌و باش گونه‌هـ ژێبرێ گونه‌هێن به‌نییێن خۆ يـێـن تۆبه‌كه‌ره‌، ويـێ دلۆڤـانكاره‌ ب وان.

‏Say, "O My servants who have transgressed against themselves [by sinning], do not despair of the mercy of Allah . Indeed, Allah forgives all sins. Indeed, it is He who is the Forgiving, the Merciful."
